import React from 'react'
import "../App.scss"
import data from "../data/dataDashboardSocialMedia"
export const Container = () => {
    return (
        <div className="container">
            <div className="item-container">
                {data.map((item) => {
                    return(
                        <div key={item.id}>
                        <img src={item.image} alt={item.alt}/>
                    </div>
                    )
                })}
                
            </div>
            
        </div>
    )
}

export default Container
